import java.util.Optional;

public class GreenCardInternalService {

    private final DownloadGreenCardRequestParamsMapper mapper = DownloadGreenCardRequestParamsMapper.INSTANCE;

    // Method to build download params
    public DownloadGreenCardRequestParams buildDownloadParams(UUID contractId, Long providerId, PolicyHolder policyHolder) {
        DownloadGreenCardRequestParams params = new DownloadGreenCardRequestParams();

        // Use the mapper and Optional for null safety
